import React, { useEffect } from 'react';


const Testing = () => {
    useEffect(() => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';

        return () => {
        document.body.style.overflow = 'auto';
        document.body.style.touchAction = 'auto';
        document.body.style.overflow = 'auto';
        };
    }, []);

    return (
        <div style={{ position: 'fixed', marginTop:'100px', height: '50%', width: '100%'}}  >
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '50%', width: '100%', color: 'white' }}>
                <h1>Testing</h1>
            </div>

















            <div
            style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100vh', // Ajustamos para ocupar toda la pantalla
                width: '100%',
                backgroundColor: '#000', // Fondo oscuro para resaltar el efecto
                color: 'white',
                gap: '10rem'
            }}
            >
            <ul
                style={{
                display: 'flex',
                listStyleType: 'none',
                padding: 0,
                gap: '10rem',
                fontSize: '5px'
                }}
            >
                {/* Primer li con el efecto de destello */}
                <li className="twinkle">
                <i className="fa-solid fa-circle"></i>
                </li>
                {/* Otros li normales */}
                <li>
                <i className="fa-solid fa-circle"></i>
                </li>
                <li>
                <i className="fa-solid fa-circle"></i>
                </li>
            </ul>
            </div>






















            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '50%', width: '100%', color: 'white', gap: '10rem' }}>
                <ul style={{ display: 'flex', listStyleType: 'none', padding: 0 , gap: '10rem' }}>
                    <li><i class="fa-solid fa-circle"></i></li>
                    <li><i class="fa-regular fa-circle"></i></li>
                    <li><i class="fa-regular fa-circle"></i></li>
                </ul>
            </div>
        </div>
    );
    };

export default Testing;
